  return (
    <div className="container">
      <button className="btn" onClick={onBack}>‚Üê Back</button>
      <div style={{marginTop:12}}>
        <WeatherCard data={data} />
      </div>
      <div className="link">2021 Fidenz Technologies</div>
    </div>
  );
}
